                {name: "Opinie", id:"/opinions", class: Opinions}];

function App() {
  document.title = "4events"
  return (
    <HashRouter>
      {
      //<div className="app">
    }
        <Header>4events.</Header>
        <MenuContainer menuList={menuList} />
        <MainPane menuList={menuList} />
      {
        //</div>
      }
    </HashRouter>
  );
}

export default App;
